    false,nt"url": null,nt"notes": "This narrative report for Stillwater Wildlife
    Management Area and Anaho Island outlines Refuge accomplishments from May through
    August of 1951. The report begins by summarizing the weather conditions and water
    conditions during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, raptors, and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, collections and receipts, and vegetation control. Resource management
    is outlined; topics include grazing. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, fishing, and violations.
    N-R forms and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
